/*convert x[species] (mole fracs) to c[species] (molar conc) */
void fgxtcp_(double * P, double * T, double * x, int * iwrk, double * rwrk, double * c)
{
    int id; /*loop counter */
    double PORT = (*P)/(8.31451000e+07 * (*T)); /*P/RT */

    /*Compute conversion, see Eq 10 */
    for (id = 0; id < 53; ++id) {
        c[id] = x[id]*PORT;
    }

    return;
}


/*convert x[species] (mole fracs) to c[species] (molar conc) */
void fgxtcr_(double * rho, double * T, double * x, int * iwrk, double * rwrk, double * c)
{
    int id; /*loop counter */
    double XW = 0; /*See Eq 4, 11 in CK Manual */
    double ROW; 
    /*Compute mean molecular wt first */
    XW += x[0]*2.0159399509429932e+00; /*H2 */
    XW += x[1]*1.0079699754714966e+00; /*H */
    XW += x[2]*1.5999400138854980e+01; /*O */
    XW += x[3]*3.1998800277709961e+01; /*O2 */
    XW += x[4]*1.7007370114326477e+01; /*OH */
    XW += x[5]*1.8015340089797974e+01; /*H2O */
    XW += x[6]*3.3006770253181458e+01; /*HO2 */
    XW += x[7]*3.4014740228652954e+01; /*H2O2 */
    XW += x[8]*1.2011150360107422e+01; /*C */
    XW += x[9]*1.3019120335578918e+01; /*CH */
    XW += x[10]*1.4027090311050415e+01; /*CH2 */
    XW += x[11]*1.4027090311050415e+01; /*CH2(S) */
    XW += x[12]*1.5035060286521912e+01; /*CH3 */
    XW += x[13]*1.6043030261993408e+01; /*CH4 */
    XW += x[14]*2.8010550498962402e+01; /*CO */
    XW += x[15]*4.4009950637817383e+01; /*CO2 */
    XW += x[16]*2.9018520474433899e+01; /*HCO */
    XW += x[17]*3.0026490449905396e+01; /*CH2O */
    XW += x[18]*3.1034460425376892e+01; /*CH2OH */
    XW += x[19]*3.1034460425376892e+01; /*CH3O */
    XW += x[20]*3.2042430400848389e+01; /*CH3OH */
    XW += x[21]*2.5030270695686340e+01; /*C2H */
    XW += x[22]*2.6038240671157837e+01; /*C2H2 */
    XW += x[23]*2.7046210646629333e+01; /*C2H3 */
    XW += x[24]*2.8054180622100830e+01; /*C2H4 */
    XW += x[25]*2.9062150597572327e+01; /*C2H5 */
    XW += x[26]*3.0070120573043823e+01; /*C2H6 */
    XW += x[27]*4.1029670834541321e+01; /*HCCO */
    XW += x[28]*4.2037640810012817e+01; /*CH2CO */
    XW += x[29]*4.2037640810012817e+01; /*HCCOH */
    XW += x[30]*1.4006699562072754e+01; /*N */
    XW += x[31]*1.5014669537544250e+01; /*NH */
    XW += x[32]*1.6022639513015747e+01; /*NH2 */
    XW += x[33]*1.7030609488487244e+01; /*NH3 */
    XW += x[34]*2.9021369099617004e+01; /*NNH */
    XW += x[35]*3.0006099700927734e+01; /*NO */
    XW += x[36]*4.6005499839782715e+01; /*NO2 */
    XW += x[37]*4.4012799263000488e+01; /*N2O */
    XW += x[38]*3.1014069676399231e+01; /*HNO */
    XW += x[39]*2.6017849922180176e+01; /*CN */
    XW += x[40]*2.7025819897651672e+01; /*HCN */
    XW += x[41]*2.8033789873123169e+01; /*H2CN */
    XW += x[42]*4.1032519459724426e+01; /*HCNN */
    XW += x[43]*4.3025220036506653e+01; /*HCNO */
    XW += x[44]*4.3025220036506653e+01; /*HOCN */
    XW += x[45]*4.3025220036506653e+01; /*HNCO */
    XW += x[46]*4.2017250061035156e+01; /*NCO */
    XW += x[47]*2.8013399124145508e+01; /*N2 */
    XW += x[48]*3.9948001861572266e+01; /*AR */
    XW += x[49]*4.3089240908622742e+01; /*C3H7 */
    XW += x[50]*4.4097210884094238e+01; /*C3H8 */
    XW += x[51]*4.3045610785484314e+01; /*CH2CHO */
    XW += x[52]*4.4053580760955811e+01; /*CH3CHO */
    ROW = (*rho) / XW;

    /*Compute conversion, see Eq 11 */
    for (id = 0; id < 53; ++id) {
        c[id] = x[id]*ROW;
    }

    return;
}


/*convert c[species] (molar conc) to x[species] (mole fracs) */
void fgctx_(double * c, int * iwrk, double * rwrk, double * x)
{
    int id; /*loop counter */
    double sumC = 0; 

    /*compute sum of c  */
    for (id = 0; id < 53; ++id) {
        sumC += c[id];
    }

    /* See Eq 13  */
    for (id = 0; id < 53; ++id) {
        x[id] = c[id]/sumC;
    }

    return;
}


