/*Returns the rate of progress for each reaction */
void fgqc_(double * T, double * C, int * iwrk, double * rwrk, double * qdot)
{
    int id; /*loop counter */

    /*convert to SI */
    for (id = 0; id < 53; ++id) {
        C[id] *= 1.0e6;
    }

    /*convert to chemkin units */
    progressRate(qdot, C, *T);

    /*convert to chemkin units */
    for (id = 0; id < 53; ++id) {
        C[id] *= 1.0e-6;
    }

    for (id = 0; id < 325; ++id) {
        qdot[id] *= 1.0e-6;
    }
}


