    e[12] = 0.000000e+00;

    /*reaction 14: O + HCO <=> H + CO2 */
    a[13] = 3.000000e+13;
    b[13] = 0.000000e+00;
    e[13] = 0.000000e+00;

    /*reaction 15: O + CH2O <=> OH + HCO */
    a[14] = 3.900000e+13;
    b[14] = 0.000000e+00;
    e[14] = 3.540000e+03;

    /*reaction 16: O + CH2OH <=> OH + CH2O */
    a[15] = 1.000000e+13;
    b[15] = 0.000000e+00;
    e[15] = 0.000000e+00;

    /*reaction 17: O + CH3O <=> OH + CH2O */
    a[16] = 1.000000e+13;
    b[16] = 0.000000e+00;
    e[16] = 0.000000e+00;

    /*reaction 18: O + CH3OH <=> OH + CH2OH */
    a[17] = 3.880000e+05;
    b[17] = 2.500000e+00;
    e[17] = 3.100000e+03;

    /*reaction 19: O + CH3OH <=> OH + CH3O */
    a[18] = 1.300000e+05;
    b[18] = 2.500000e+00;
    e[18] = 5.000000e+03;

    /*reaction 20: O + C2H <=> CH + CO */
    a[19] = 5.000000e+13;
    b[19] = 0.000000e+00;
