    /*reaction 15: O + CH2O <=> OH + HCO */
    phi_f = sc[2]*sc[17];
    k_f = 1.000000e-06 * 3.900000e+13*exp(-1.781387e+03/tc[1]);
    q_f = phi_f * k_f;
    phi_r = sc[4]*sc[16];
    Kc = exp((g_RT[2] + g_RT[17]) - (g_RT[4] + g_RT[16]));
    k_r = k_f / Kc;
    q_r = phi_r * k_r;
    qdot = q_f - q_r;
    wdot[2] -= qdot;
