    phi_f = sc[2]*sc[20];
    k_f = 1.000000e-06 * 1.300000e+05*exp(2.500000e+00*tc[0]-2.516083e+03/tc[1]);
    q_f = phi_f * k_f;
    phi_r = sc[4]*sc[19];
    Kc = exp((g_RT[2] + g_RT[20]) - (g_RT[4] + g_RT[19]));
