    qij[311 * kd + 35] = dq_c;
    qij[311 * kd + 36] = dq_c;
    qij[311 * kd + 37] = dq_c;
    qij[311 * kd + 38] = dq_c;
    qij[311 * kd + 39] = dq_c;
    qij[311 * kd + 40] = dq_c;
    qij[311 * kd + 41] = dq_c;
    qij[311 * kd + 42] = dq_c;
    qij[311 * kd + 43] = dq_c;
    qij[311 * kd + 44] = dq_c;
    qij[311 * kd + 45] = dq_c;
    qij[311 * kd + 46] = dq_c;
    qij[311 * kd + 47] = dq_c;
    qij[311 * kd + 48] = dq_c * 0.700000;
    qij[311 * kd + 49] = dq_c;
    qij[311 * kd + 50] = dq_c - 1 * k_r;
