    /********************************************************************************* */
    /*        reaction 318: CH3 + C2H4 (+M) <=> C3H7 (+M) -- (Troe)                    */
    /********************************************************************************* */
    phi_f = sc[12]*sc[24];
    alpha = mixture + sc[0] + 5.000000e+00*sc[5] + sc[13] + 5.000000e-01*sc[14] + sc[15] + 2.000000e+00*sc[26] + -3.000000e-01*sc[48];
    /* Begin block -- shared by all falloff reactions */
    k_high = 1.000000e-06 * 2.550000e+06*exp(1.600000e+00*tc[0]-2.868335e+03/tc[1]);
    k_low = 1.000000e-06 * 3.000000e+63*exp(-1.460000e+01*tc[0]-9.143447e+03/tc[1]);
    redP = 1.0e-6 * alpha *  k_low / k_high;  /* redP has units of concentration CGS */
    F = redP / (1 + redP);
    dFdP = 1 / (1 + redP) - redP / ((1+redP)*(1+redP));
    k_f = k_high; /*forward coefficient for now... */
    /* End block -- shared by all falloff reactions */
    /* Begin block -- Troe form ! */
        logPred = log10(redP);
        logFcent = log10((8.106000e-01*exp(T/-2.770000e+02))+ (1.894000e-01*exp(T/-8.748000e+03))+ (exp(-7.891000e+03/T)));
        troe_c = -.4 - .67 * logFcent;
        troe_n = .75 - 1.27 * logFcent;
        troe = (troe_c + logPred) / (troe_n - .14*(troe_c + logPred));
        F_troe = pow(10, logFcent / (1.0 + troe*troe));
        /* begin -- difference approximation of dF_troe/dP */
            redPP  = redP*1.001+1.0e-8;
            logPred = log10(redPP);
            troe = (troe_c + logPred) / (troe_n - .14*(troe_c + logPred));
            F_troe2 = pow(10, logFcent / (1.0 + troe*troe));
            dF_troe = (F_troe2 - F_troe) / (redPP - redP) ;
        /* end -- difference approximation of dF_troe/dP */
        dFdP = dFdP * F_troe + (redP/(1+redP)) * dF_troe ;
        k_fc   = k_low * dFdP * 1.0e-6;
        chain2 = k_f * F * F_troe;
        k_f *= F * F_troe;
    /* End block -- Troe form ! */
    /* Begin block -- shared by all reversible reactions */
        phi_r = sc[49];
        Kc = 1.0 / (refC) * exp((g_RT[12] + g_RT[24]) - (g_RT[49]));
        k_r = k_f / Kc;
    /* End block -- shared by all reversible reactions */
    dq_c = k_fc * (phi_f - phi_r / Kc);   /* for all rxns with a thirdbody */

    /* Ready! */
    qij[317 * kd + 0] = dq_c * 2.000000;
    qij[317 * kd + 1] = dq_c;
    qij[317 * kd + 2] = dq_c;
    qij[317 * kd + 3] = dq_c;
    qij[317 * kd + 4] = dq_c;
