    qij[317 * kd + 7] = dq_c;
    qij[317 * kd + 8] = dq_c;
    qij[317 * kd + 9] = dq_c;
    qij[317 * kd + 10] = dq_c;
    qij[317 * kd + 11] = dq_c;
    qij[317 * kd + 12] = dq_c + sc[24] * chain2;
    qij[317 * kd + 13] = dq_c * 2.000000;
    qij[317 * kd + 14] = dq_c * 1.500000;
    qij[317 * kd + 15] = dq_c * 2.000000;
    qij[317 * kd + 16] = dq_c;
    qij[317 * kd + 17] = dq_c;
    qij[317 * kd + 18] = dq_c;
