    qij[317 * kd + 21] = dq_c;
    qij[317 * kd + 22] = dq_c;
    qij[317 * kd + 23] = dq_c;
    qij[317 * kd + 24] = dq_c + sc[12] * chain2;
    qij[317 * kd + 25] = dq_c;
