    /********************************************************************************* */
    /*        reaction 319: O + C3H7 <=> C2H5 + CH2O -- Standard form                  */
    /********************************************************************************* */
    phi_f = sc[2]*sc[49];
    k_f = 1.000000e-06 * 9.640000e+13;
    /* Begin block -- shared by all reversible reactions */
        phi_r = sc[25]*sc[17];
        Kc = exp((g_RT[2] + g_RT[49]) - (g_RT[25] + g_RT[17]));
        k_r = k_f / Kc;
    /* End block -- shared by all reversible reactions */

    /* Ready! */
    qij[318 * kd + 2] = sc[49] * k_f;
    qij[318 * kd + 17] = -sc[25] * k_r;
    qij[318 * kd + 25] = -sc[17] * k_r;
    qij[318 * kd + 49] = sc[2] * k_f;

    /********************************************************************************* */
    /*        reaction 320: H + C3H7 (+M) <=> C3H8 (+M) -- (Troe)                      */
    /********************************************************************************* */
    phi_f = sc[1]*sc[49];
    alpha = mixture + sc[0] + 5.000000e+00*sc[5] + sc[13] + 5.000000e-01*sc[14] + sc[15] + 2.000000e+00*sc[26] + -3.000000e-01*sc[48];
    /* Begin block -- shared by all falloff reactions */
    k_high = 1.000000e-06 * 3.613000e+13;
    k_low = 1.000000e-06 * 4.420000e+61*exp(-1.354500e+01*tc[0]-5.715032e+03/tc[1]);
    redP = 1.0e-6 * alpha *  k_low / k_high;  /* redP has units of concentration CGS */
    F = redP / (1 + redP);
    dFdP = 1 / (1 + redP) - redP / ((1+redP)*(1+redP));
    k_f = k_high; /*forward coefficient for now... */
    /* End block -- shared by all falloff reactions */
    /* Begin block -- Troe form ! */
        logPred = log10(redP);
        logFcent = log10((6.850000e-01*exp(T/-3.690000e+02))+ (3.150000e-01*exp(T/-3.285000e+03))+ (exp(-6.667000e+03/T)));
        troe_c = -.4 - .67 * logFcent;
        troe_n = .75 - 1.27 * logFcent;
        troe = (troe_c + logPred) / (troe_n - .14*(troe_c + logPred));
        F_troe = pow(10, logFcent / (1.0 + troe*troe));
        /* begin -- difference approximation of dF_troe/dP */
            redPP  = redP*1.001+1.0e-8;
            logPred = log10(redPP);
            troe = (troe_c + logPred) / (troe_n - .14*(troe_c + logPred));
            F_troe2 = pow(10, logFcent / (1.0 + troe*troe));
