    k_f = 1.000000e-06 * 4.060000e+06*exp(2.190000e+00*tc[0]-4.478628e+02/tc[1]);
    /* Begin block -- shared by all reversible reactions */
        phi_r = sc[12]*sc[25];
        Kc = exp((g_RT[1] + g_RT[49]) - (g_RT[12] + g_RT[25]));
        k_r = k_f / Kc;
    /* End block -- shared by all reversible reactions */

    /* Ready! */
    qij = sc[49] * k_f;
    jac[1 * 53 + 1] -= 1 * qij;
    jac[1 * 53 + 49] -= 1 * qij;
    jac[1 * 53 + 12] += 1 * qij;
    jac[1 * 53 + 25] += 1 * qij;
    qij = -sc[25] * k_r;
    jac[12 * 53 + 1] -= 1 * qij;
    jac[12 * 53 + 49] -= 1 * qij;
    jac[12 * 53 + 12] += 1 * qij;
    jac[12 * 53 + 25] += 1 * qij;
    qij = -sc[12] * k_r;
    jac[25 * 53 + 1] -= 1 * qij;
    jac[25 * 53 + 49] -= 1 * qij;
    jac[25 * 53 + 12] += 1 * qij;
    jac[25 * 53 + 25] += 1 * qij;
    qij = sc[1] * k_f;
    jac[49 * 53 + 1] -= 1 * qij;
    jac[49 * 53 + 49] -= 1 * qij;
    jac[49 * 53 + 12] += 1 * qij;
    jac[49 * 53 + 25] += 1 * qij;

    /********************************************************************************* */
    /*        reaction 322: OH + C3H7 <=> C2H5 + CH2OH -- Standard form                */
    /********************************************************************************* */
