    k_f = 1.000000e-06 * 2.410000e+13;
    /* Begin block -- shared by all reversible reactions */
        phi_r = sc[25]*sc[18];
        Kc = exp((g_RT[4] + g_RT[49]) - (g_RT[25] + g_RT[18]));
        k_r = k_f / Kc;
    /* End block -- shared by all reversible reactions */

    /* Ready! */
    qij = sc[49] * k_f;
    jac[4 * 53 + 4] -= 1 * qij;
    jac[4 * 53 + 49] -= 1 * qij;
    jac[4 * 53 + 25] += 1 * qij;
    jac[4 * 53 + 18] += 1 * qij;
    qij = -sc[25] * k_r;
    jac[18 * 53 + 4] -= 1 * qij;
