    /* Begin block -- shared by all reversible reactions */
        phi_r = sc[3]*sc[50];
        Kc = exp((g_RT[6] + g_RT[49]) - (g_RT[3] + g_RT[50]));
        k_r = k_f / Kc;
    /* End block -- shared by all reversible reactions */

    /* Ready! */
    qij = -sc[50] * k_r;
    jac[3 * 53 + 6] -= 1 * qij;
    jac[3 * 53 + 49] -= 1 * qij;
    jac[3 * 53 + 3] += 1 * qij;
    jac[3 * 53 + 50] += 1 * qij;
    qij = sc[49] * k_f;
    jac[6 * 53 + 6] -= 1 * qij;
    jac[6 * 53 + 49] -= 1 * qij;
    jac[6 * 53 + 3] += 1 * qij;
    jac[6 * 53 + 50] += 1 * qij;
    qij = sc[6] * k_f;
    jac[49 * 53 + 6] -= 1 * qij;
    jac[49 * 53 + 49] -= 1 * qij;
    jac[49 * 53 + 3] += 1 * qij;
    jac[49 * 53 + 50] += 1 * qij;
    qij = -sc[3] * k_r;
    jac[50 * 53 + 6] -= 1 * qij;
    jac[50 * 53 + 49] -= 1 * qij;
    jac[50 * 53 + 3] += 1 * qij;
    jac[50 * 53 + 50] += 1 * qij;

    /********************************************************************************* */
    /*        reaction 324: HO2 + C3H7 => OH + C2H5 + CH2O -- Standard form            */
    /********************************************************************************* */
    phi_f = sc[6]*sc[49];
    k_f = 1.000000e-06 * 2.410000e+13;
