    jac[6 * 53 + 25] += 1 * qij;
    jac[6 * 53 + 17] += 1 * qij;
    qij = sc[6] * k_f;
    jac[49 * 53 + 6] -= 1 * qij;
    jac[49 * 53 + 49] -= 1 * qij;
    jac[49 * 53 + 4] += 1 * qij;
    jac[49 * 53 + 25] += 1 * qij;
    jac[49 * 53 + 17] += 1 * qij;

    /********************************************************************************* */
    /*        reaction 325: CH3 + C3H7 <=> 2 C2H5 -- Standard form                     */
    /********************************************************************************* */
    phi_f = sc[12]*sc[49];
    k_f = 1.000000e-06 * 1.927000e+13*exp(-3.200000e-01*tc[0]);
